import { Card, CardMedia } from "@mui/material";
import React from "react";
import {faChevronLeft, faChevronRight, faQuoteRight} from "react-icons/fa";

export default function ReviewContent({id, name, job, image, text}) {
    return (
        <Card>
            <CardMedia component="img" height="194" image={image} sx={{
                position: "relative",
                width: 150,
                height: 150,
                borderRadius: "50%",
                margin: "auto",
                marginBottom: "1.5rem",
                objectFit: "cover",
                display: "block",
                backgroundColor: "#49adef",
            }}>
            </CardMedia>
        </Card>
    );
}
